import Properties from "./Properties"
const Header=(p)=>{
    return( <div>
        <Properties Address="This is my address"></Properties>
        <h1>Hello World! hi</h1>
       <p>"my name is "{p.name} "my age is"{p.age}</p>
        </div>)
}
export default Header
